import { useParams } from "react-router-dom";
import httpInstance from "../httpInstance";

export const getDetailsMovies = async () => {
    let res: any;
    const {id} = useParams();
    const endpoint = `${id}?api_key=${process.env.REACT_APP_MDB_AI_API_KEY}&language=en-US`;
    await httpInstance
    .get(endpoint)
    .then((response) => {
        res = response;
        console.log(res);
    })
    .catch((err) => {
        res = err.response
    });
    return res;
}
